  return (
    <div className='w-full flex p-2'>
      <img src={photo} className='ml-10 rounded-full w-20 h-20'/>

      <div id='docInfo' className='w-full ml-2 text-xl'>
        Anna Szyszka

      </div>

    </div>
  )
}
